//假设我们要计算的数据为{0x01, 0x02, 0x03, 0x04}：
//1. 预处理：01 02 03 04
//2. 初始化：CRC = 0xFFFF
//3. 计算：
//    - 处理01：CRC = CRC xor 01，得到 0xFFFE
//    - 处理02：CRC = CRC xor 02，得到 0xFFFC
//    - 处理03：CRC = CRC xor 03，得到 0xFFF8
//    - 处理04：CRC = CRC xor 04，得到 0xFFF0
//4. 反转：将CRC值的高位和低位进行反转，得到校验值为0xF0FF。

public static ushort CalculateCrc(byte[] data)
{
    ushort crc = 0xFFFF;
    for (int i = 0; i < data.Length; i++)
    {
        crc ^= data[i];
        for (int j = 0; j < 8; j++)
        {
            if ((crc & 0x0001) != 0)
            {
                crc >>= 1;
                crc ^= 0xA001;
            }
            else
            {
                crc >>= 1;
            }
        }
    }
    crc = (ushort)((crc << 8) | (crc >> 8));
    return crc;
}

//下面是一个示例，假设要计算的数据为0x01 0x02 0x03 0x04，那么CRC校验码的计算过程如下：
//1. 初始化寄存器为0xFFFF。
//2. 将0x01放入寄存器中，进行运算，得到寄存器的值为0xC5C8。
//3. 将0x02放入寄存器中，进行运算，得到寄存器的值为0x8D4F。
//4. 将0x03放入寄存器中，进行运算，得到寄存器的值为0x402A。
//5. 将0x04放入寄存器中，进行运算，得到寄存器的值为0x28CB。
//6. 最终寄存器的值为0x28CB，即为CRC校验码。

#include <stdint.h>

uint16_t crc_table[256] = {
    0x0000, 0x1189, 0x2312, 0x329B, 0x4624, 0x57AD, 0x6536, 0x74BF,
    0x8C48, 0x9DC1, 0xAF5A, 0xBED3, 0xCA6C, 0xDBE5, 0xE97E, 0xF8F7,
    // 省略部分代码
};

uint16_t crc16(uint8_t *data, uint16_t length) {
    uint16_t crc = 0xFFFF;
    for (int i = 0; i < length; i++) {
        uint8_t index = (crc ^ data[i]) & 0xFF;
        crc = (crc >> 8) ^ crc_table[index];
    }
    return crc;
}
